import Box from "../components/Box";

function HomePage() {
    return (
        <>
            <Box>
                <h2>Getting Started</h2>
            </Box>

            <Box>
                <h2>Activity</h2>
            </Box>

            <Box>
                <h2>Upcoming Meet Ups</h2>
            </Box>
        </>
    );
}

export default HomePage;
